contracts/auction.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract AuctionC {
    address public o;
    uint256 public hb;
    address public hba;
    bool public oe;

    constructor() {
        o = msg.sender;
        hb = 0;
        oe = false;
    }

    function bid(uint256 a) public payable {
        require(!oe, "Auction has already ended");
        hb = a;
        require(msg.value > hb, "Bid must be greater then current value");

        hba = msg.sender;
    }

    function endA() public {
        require(msg.sender == o, "only owner can end");
        oe = true;
    }

    function withdraw() public view returns (uint256) {
        require(msg.sender == hba, "only highest bidder can withdraw");
        return hb;
    }
}

contract AddNumbers {
    function add(uint256 a, uint256 b) public pure returns (uint256) {
        return a + b;
    }
}

